import react from '../images/react.png';

import DividerComponent from "./DividerComponent";

export default function TechComponent() {

    const div = <DividerComponent name="Technologies"/>;

    return (
        <div className="tech-component">
            {div}
            <div className="tech-packet">
                <div className="tech">
                <figure class="fig"><img class="img-cover" src={react}/>
                    <figcaption class="fig-caption u-text-center">Image with <code>img-cover</code></figcaption>
                </figure>
                </div>
            </div>
        </div>
    );
}
